import { useState } from "react";

export function Profile(){
    const [isEditingPassword, setIsEditingPassword] = useState(false);
    const [passwordVisible, setPasswordVisible] = useState(false);
    const [password, setPassword] = useState('secret123');
    const [originalPassword, setOriginalPassword] = useState(password);
    const [showProfile, setShowProfile] = useState(true);
  
    const handleEditPassword = () => {
      setIsEditingPassword(true);
    };
  
    const handleCancelEdit = () => {
      setPassword(originalPassword);
      setIsEditingPassword(false);
      setPasswordVisible(false);
    };
  
    const handleSavePassword = () => {
      setOriginalPassword(password);
      setIsEditingPassword(false);
      setPasswordVisible(false);
      alert('Password updated!');
    };
  
    const togglePasswordVisibility = () => {
      setPasswordVisible((prev) => !prev);
    };
  
    if (!showProfile) return null;
  
    return (
      <div className="profilePage">
        <div className="profileHeader">
          <h1>Employee Profile</h1>
          <button className="profileCloseBtn" onClick={() => setShowProfile(false)}>&times;</button>
        </div>
  
        <div className="profileContent">
          <div className="profileSectionTitle">Personal Information</div>
          <div className="profileInfoRow"><div className="profileLabel">Name:</div><div className="profileValue">Jane Doe</div></div>
          <div className="profileInfoRow"><div className="profileLabel">Employee ID:</div><div className="profileValue">EMP00123</div></div>
          <div className="profileInfoRow"><div className="profileLabel">Email:</div><div className="profileValue">jane.doe@example.com</div></div>
  
          <div className="profileSectionTitle">Professional Information</div>
          <div className="profileInfoRow"><div className="profileLabel">Position:</div><div className="profileValue">Manager</div></div>
          <div className="profileInfoRow"><div className="profileLabel">Reporting Manager:</div><div className="profileValue">John Smith</div></div>
          <div className="profileInfoRow"><div className="profileLabel">Manager ID:</div><div className="profileValue">MGR102</div></div>
  
          <div className="profileSectionTitle">Security</div>
          <div className="profileInfoRow profilePasswordRow">
            <div className="profileLabel">Password:</div>
            <div className="profileValue" style={{ display: 'flex', alignItems: 'center', position: 'relative' }}>
              <input
                type={passwordVisible ? 'text' : 'password'}
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                disabled={!isEditingPassword}
                className="profilePasswordInput"
              />
              {(
                <button
                  onClick={togglePasswordVisibility}
                  className="profileTogglePasswordBtn"
                  title="Show/Hide Password"
                >
                  {/* {passwordVisible ? 'üôà' : 'üëÅ'} */}
                  <span className="material-icons"  style={{ position: 'absolute', right: '10px', top: '50%', transform: 'translateY(-50%)', cursor: 'pointer', color: '#555', }}
                        title={passwordVisible ? 'Hide Password' : 'Show Password'}>
                        {passwordVisible ? 'visibility_off' : 'visibility'}
                    </span>
                </button>
              )}
            </div>
          </div>
  
          <div className="profileButtonGroup">
            {!isEditingPassword ? (
              <button className="profileBtn edit" onClick={handleEditPassword}>Edit Password</button>
            ) : (
              <>
                <button className="profileBtn save" onClick={handleSavePassword}>Save</button>
                <button className="profileBtn cancel" onClick={handleCancelEdit}>Cancel</button>
              </>
            )}
          </div>
        </div>
      </div>
    );
}
